import React from 'react';
import './style.css'
function WhiteContainer(props) {
    return (
        <div style={{maxHeight : '70%', overflow : 'auto'}}>
        <div className='container-1'>
            <div className='container-2'>
                <div className='container-3'>
                    {props.children}
                </div>
            </div>
        </div>
        </div>

    );
}

export default WhiteContainer;
